class Solution:
    def maxOperations(self, s: str) -> int:
        one_cnt = 0
        result = 0
        for i in range(len(s)):
            if s[i] == '1':
                one_cnt += 1
            elif i == len(s) - 1 or s[i + 1] == '1':
                result += one_cnt

        return result
